import React, { useEffect } from 'react'
import {
    Link,
    Route,
    Routes,
    NavLink
} from 'react-router-dom';
import SearchNum from '../sitepagenumsearch/App';
import SearchVin from '../sitepagevinsearch/sitepagevinsearch';
import './App.css';

function App() {
    return (
        <div className="App">
            <div>
            <div id="burger-menu"></div>
                <div  className='menudiv'> 
                    <NavLink className='linkstyle' to={'/SearchNum'}>
                        Все о товаре
                    </NavLink>
                    <NavLink to={'/SearchVin'} 
                       className='linkstyle' >
                        Характеристики
                    </NavLink>

                </div>
            </div>
            <Routes>
                <Route path="/searchNum"
                    element={<SearchNum />} />
                <Route path="/about"
                    element={<SearchVin />} />

            </Routes>

        </div>
    );
}

export default App;
